  AppController.$inject = ['$rootScope', '$http', '$location', '$timeout', '$route', '$window', '$mdSidenav', 'Auth', 'xhrInProgress'];
  Config.$inject = ['$sceDelegateProvider', '$routeProvider', 'AuthProvider'];

